def _partially_consume_prefix(self, prefix, column):

    lines = []
    current_line = ""
    current_column = 0
    for char in prefix:
        if char == '\n':
            if current_line.strip() and current_column < column:
                res = ''.join(lines)
                return res, prefix[len(res):]

            lines.append(current_line + '\n')
            current_line = ""
            current_column = 0
        elif char == ' ':
            current_column += 1
            current_line += char
        elif char == '\t':
            current_column += 4  # Assuming tab size is 4
            current_line += char
        else:
            current_column += 1
            current_line += char

    return ''.join(lines), current_line
